var statData_0__Total_3927445408_ID = []
function OnLoaded_ID(evt)
{
    var legendPanel = document.getElementById('LegendPanel_ID');
    var legendRect = document.getElementById('legendPanelRect_ID');
    var legendBbox = legendPanel.getBBox();
    legendRect.setAttribute('width',legendBbox.width+80);
    legendRect.setAttribute('height',legendBbox.height+8);
    legendRect.setAttribute('x',legendRect.getAttribute('x')-legendBbox.width);
}
function FindInterestingFrame_ID(x,range) { return x; }
function GetGraphX(mouseX)
{
  return (mouseX - 0) * (0 - 0) / 1800 + 0;
}

function compareSamples(a, b)
{
      if (a.value > b.value)
          return -1;
      if (a.value < b.value)
          return 1;
      return 0;
}
function ToSvgX(graphX)
{
    scaleX = Infinity;
    return 0 + (graphX - 0) * scaleX;
}
function OnGraphAreaClicked_ID(evt)
{
  graphX = GetGraphX(evt.offsetX); 
  var interactivePanel = document.getElementById('interactivePanel_ID');
  var legendPanel = document.getElementById('LegendPanel_ID');
  var frameNum = FindInterestingFrame_ID( Math.round(graphX+0.5), 0 );
  if (frameNum >= 0 && frameNum < 0)
  {
    var xOffset = 0;
    var lineX = ToSvgX(frameNum);
    var textX = lineX + xOffset;
    var textY = 0 - 20
    var interactivePanelInner = document.getElementById('interactivePanelInner_ID');
    legendPanel.setAttribute('visibility','hidden')
    interactivePanel.setAttribute('visibility','visible')
    interactivePanel.setAttribute('transform','translate('+textX+',0)')
    var dataIndex = Math.round( frameNum * 1 );
    var samples = [
            { value: frameNum, name: 'Frame', colour: 'rgb(0,0,0)', groupElement: document.getElementById('csvFrameGroup_ID'), textElement: document.getElementById('csvFrameText_ID') },
            { value: statData_0__Total_3927445408_ID[dataIndex], name: 'Total', colour: 'rgb(110, 110, 110)', groupElement: document.getElementById('csvStatGroup__0_Total_3927445408_ID'), textElement: document.getElementById('csvStatText__0_Total_3927445408_ID') },
    ];
    samples.sort(compareSamples);
    var panelInner = document.getElementById('interactivePanelInner_ID');
    var panelInnerHidden = document.getElementById('interactivePanelInnerHidden_ID');
    while (panelInner.childNodes.length>0)
    {
        panelInnerHidden.appendChild(panelInner.childNodes[0]);
    }
    var maxSampleCountToDisplay=36.66667;
    for ( i=0;i<samples.length;i++ )
    {
        var groupElement = samples[i].groupElement;
        if ( samples[i].value > 0 && i<=maxSampleCountToDisplay)
        {
            groupElement.setAttribute('transform','translate(0,'+textY+')');
            var textElement = samples[i].textElement;
            var textNode = document.createTextNode(samples[i].value);
            textElement.replaceChild(textNode,textElement.childNodes[0]); 
            if (groupElement.parentNode != panelInner)
              panelInner.appendChild(groupElement);
            textY += 15;
        }
        else
        {
            if (groupElement.parentNode != panelInnerHidden)
                panelInnerHidden.appendChild(groupElement);
        }
    }
    var panelRect = document.getElementById('interactivePanelRect_ID');
    var bbox = interactivePanelInner.getBBox();
    panelRect.setAttribute('width',bbox.width+16);
    panelRect.setAttribute('height',textY+8);
    panelRect.setAttribute('x',bbox.x-8);
    panelRect.setAttribute('y',bbox.y-8);
    var panelOffset = 0;
    if ( bbox.x + textX < 0 )
    {
        panelOffset = -(bbox.x + textX);
    }
    else if ( bbox.x+bbox.width + textX > 1800 ) 
    {    
        panelOffset = 1800-(bbox.x+bbox.width + textX);
    }   
    var interactivePanelInnerWithRect = document.getElementById('interactivePanelInnerWithRect_ID');
    interactivePanelInnerWithRect.setAttribute('transform','translate('+panelOffset+',0)');
  }
  else
  {
    interactivePanel.setAttribute('visibility','hidden')
    legendPanel.setAttribute('visibility','visible')
  }
}
